/**
 * Router for message renderers
 * Dispatches to UserMessage or AssistantMessage based on role
 */

import type { ChatMessage } from '../../shared/types/chat';
import { UserMessage } from './UserMessage';
import { AssistantMessage } from './AssistantMessage';

interface MessageRendererProps {
  message: ChatMessage;
  toolResults?: Map<string, { content: string; is_error?: boolean }>;
}

export function MessageRenderer({ message, toolResults }: MessageRendererProps) {
  switch (message.role) {
    case 'user':
      return <UserMessage message={message} />;

    case 'assistant':
      return <AssistantMessage message={message} toolResults={toolResults} />;

    case 'system':
      // Optionally render system messages with minimal styling
      return (
        <div className="mb-4 text-center">
          <div className="inline-block px-3 py-1 rounded-full bg-muted text-muted-foreground text-xs">
            System message
          </div>
        </div>
      );

    default:
      console.warn('Unknown message role:', message.role);
      return null;
  }
}

/**
 * Renderer for tool results
 * Shows output with error/success styling
 */

import { useState } from 'react';
import { AlertCircle, CheckCircle2, ChevronDown, ChevronRight } from 'lucide-react';
import { Button } from '../../ui/button';
import { Collapsible, CollapsibleContent, CollapsibleTrigger } from '../../ui/collapsible';

interface ToolResultRendererProps {
  result: string;
  isError?: boolean;
}

const MAX_LENGTH_BEFORE_COLLAPSE = 500;

export function ToolResultRenderer({ result, isError = false }: ToolResultRendererProps) {
  const shouldCollapse = result.length > MAX_LENGTH_BEFORE_COLLAPSE;
  const [isOpen, setIsOpen] = useState(!shouldCollapse);

  const Icon = isError ? AlertCircle : CheckCircle2;
  const iconColor = isError ? 'text-red-500' : 'text-green-500';
  const bgColor = isError ? 'bg-red-50 dark:bg-red-950/20' : 'bg-green-50 dark:bg-green-950/20';
  const borderColor = isError ? 'border-red-200 dark:border-red-800' : 'border-green-200 dark:border-green-800';

  const content = (
    <div className={`rounded-md border ${borderColor} ${bgColor} overflow-hidden`}>
      <div className="flex items-center gap-2 px-3 py-2">
        <Icon className={`h-4 w-4 ${iconColor} flex-shrink-0`} />
        <span className="text-sm font-medium">
          {isError ? 'Error' : 'Success'}
        </span>
        {shouldCollapse && (
          <CollapsibleTrigger asChild>
            <Button variant="ghost" size="sm" className="ml-auto h-6 px-2">
              {isOpen ? (
                <>
                  <ChevronDown className="h-3 w-3 mr-1" />
                  Collapse
                </>
              ) : (
                <>
                  <ChevronRight className="h-3 w-3 mr-1" />
                  Expand
                </>
              )}
            </Button>
          </CollapsibleTrigger>
        )}
      </div>

      <div className={`border-t ${borderColor} px-3 py-2`}>
        <pre className="font-mono text-xs whitespace-pre-wrap break-words">
          {result}
        </pre>
      </div>
    </div>
  );

  if (shouldCollapse) {
    return (
      <Collapsible open={isOpen} onOpenChange={setIsOpen}>
        <CollapsibleContent>
          {content}
        </CollapsibleContent>
      </Collapsible>
    );
  }

  return content;
}

/**
 * User message component
 * Right-aligned with blue bubble design
 */

import type { ChatMessage, TextBlock } from "../../shared/types/chat";

interface UserMessageProps {
  message: ChatMessage;
}

export function UserMessage({ message }: UserMessageProps) {
  // Extract text content from content blocks
  const textContent = message.content
    .filter((block): block is TextBlock => block.type === "text")
    .map((block) => block.text)
    .join("\n\n");

  // Format timestamp
  const formattedTime = new Date(message.timestamp).toLocaleTimeString(
    "en-US",
    {
      hour: "2-digit",
      minute: "2-digit",
    }
  );

  return (
    <div className="flex justify-end mb-4">
      <div className="max-w-[80%] space-y-1">
        {/* Timestamp */}
        <div className="text-xs text-muted-foreground text-right pr-1">
          {formattedTime}
        </div>

        {/* Message bubble */}
        <div className="user-messagerounded-lg bg-primary text-primary-foreground px-4 py-3 shadow-sm">
          <div className="whitespace-pre-wrap break-words text-sm">
            <pre>Text content:{textContent}</pre>
            <pre>{JSON.stringify(message, null, 2)}</pre>
          </div>
        </div>
      </div>
    </div>
  );
}

