/**
 * Renderer for tool results
 * Shows output with error/success styling
 */

import { useState } from 'react';
import { AlertCircle, CheckCircle2, ChevronDown, ChevronRight } from 'lucide-react';
import { Button } from '../../ui/button';
import { Collapsible, CollapsibleContent, CollapsibleTrigger } from '../../ui/collapsible';

interface ToolResultRendererProps {
  result: string;
  isError?: boolean;
}

const MAX_LENGTH_BEFORE_COLLAPSE = 500;

export function ToolResultRenderer({ result, isError = false }: ToolResultRendererProps) {
  const shouldCollapse = result.length > MAX_LENGTH_BEFORE_COLLAPSE;
  const [isOpen, setIsOpen] = useState(!shouldCollapse);

  const Icon = isError ? AlertCircle : CheckCircle2;
  const iconColor = isError ? 'text-red-500' : 'text-green-500';
  const bgColor = isError ? 'bg-red-50 dark:bg-red-950/20' : 'bg-green-50 dark:bg-green-950/20';
  const borderColor = isError ? 'border-red-200 dark:border-red-800' : 'border-green-200 dark:border-green-800';

  const content = (
    <div className={`rounded-md border ${borderColor} ${bgColor} overflow-hidden`}>
      <div className="flex items-center gap-2 px-3 py-2">
        <Icon className={`h-4 w-4 ${iconColor} flex-shrink-0`} />
        <span className="text-sm font-medium">
          {isError ? 'Error' : 'Success'}
        </span>
        {shouldCollapse && (
          <CollapsibleTrigger asChild>
            <Button variant="ghost" size="sm" className="ml-auto h-6 px-2">
              {isOpen ? (
                <>
                  <ChevronDown className="h-3 w-3 mr-1" />
                  Collapse
                </>
              ) : (
                <>
                  <ChevronRight className="h-3 w-3 mr-1" />
                  Expand
                </>
              )}
            </Button>
          </CollapsibleTrigger>
        )}
      </div>

      <div className={`border-t ${borderColor} px-3 py-2`}>
        <pre className="font-mono text-xs whitespace-pre-wrap break-words">
          {result}
        </pre>
      </div>
    </div>
  );

  if (shouldCollapse) {
    return (
      <Collapsible open={isOpen} onOpenChange={setIsOpen}>
        <CollapsibleContent>
          {content}
        </CollapsibleContent>
      </Collapsible>
    );
  }

  return content;
}

/**
 * Assistant message component
 * Left-aligned with AI avatar
 */

import { Bot, Loader2 } from 'lucide-react';
import { Avatar, AvatarFallback } from '../ui/avatar';
import type { ChatMessage } from '../../shared/types/chat';
import { ContentBlockRenderer } from './ContentBlockRenderer';

interface AssistantMessageProps {
  message: ChatMessage;
  toolResults?: Map<string, { content: string; is_error?: boolean }>;
}

export function AssistantMessage({ message, toolResults }: AssistantMessageProps) {
  // Format timestamp
  const formattedTime = new Date(message.timestamp).toLocaleTimeString('en-US', {
    hour: '2-digit',
    minute: '2-digit'
  });

  return (
    <div className="flex gap-3 mb-4">
      {/* Avatar */}
      <Avatar className="h-10 w-10 flex-shrink-0">
        <AvatarFallback className="bg-primary text-primary-foreground">
          <Bot className="h-5 w-5" />
        </AvatarFallback>
      </Avatar>

      {/* Content */}
      <div className="flex-1 space-y-3 min-w-0">
        {/* Header */}
        <div className="flex items-center gap-2">
          <span className="text-sm font-medium">Assistant</span>
          <span className="text-xs text-muted-foreground">{formattedTime}</span>
          {message.isStreaming && (
            <div className="flex items-center gap-1 text-xs text-muted-foreground">
              <Loader2 className="h-3 w-3 animate-spin" />
              Streaming...
            </div>
          )}
        </div>

        {/* Content blocks */}
        <div className="space-y-3">
          {message.content.map((block, index) => (
            <ContentBlockRenderer
              key={index}
              block={block}
              toolResults={toolResults}
            />
          ))}
        </div>
      </div>
    </div>
  );
}

/**
 * Router for tool-specific input renderers
 * Dispatches to appropriate renderer based on tool name
 */

import type { EditToolInput, WriteToolInput, ReadToolInput, BashToolInput } from '../../../shared/types/chat';
import { EditToolRenderer } from './EditToolRenderer';
import { WriteToolRenderer } from './WriteToolRenderer';
import { ReadToolRenderer } from './ReadToolRenderer';
import { BashToolRenderer } from './BashToolRenderer';

interface ToolInputRendererProps {
  toolName: string;
  input: Record<string, unknown>;
}

/**
 * Render tool input based on tool name
 *
 * To add a new tool renderer:
 * 1. Create a new tool renderer component (e.g., MyToolRenderer.tsx)
 * 2. Import it here
 * 3. Add a case in the switch statement below
 * 4. Add the tool input type to chat.ts if needed
 *
 * @example
 * ```tsx
 * case 'MyTool':
 *   return <MyToolRenderer input={input as MyToolInput} />;
 * ```
 */
export function ToolInputRenderer({ toolName, input }: ToolInputRendererProps) {
  switch (toolName) {
    case 'Edit':
      return <EditToolRenderer input={input as EditToolInput} />;

    case 'Write':
      return <WriteToolRenderer input={input as WriteToolInput} />;

    case 'Read':
      return <ReadToolRenderer input={input as ReadToolInput} />;

    case 'Bash':
      return <BashToolRenderer input={input as BashToolInput} />;

    case 'Glob':
    case 'Grep':
      // Simple renderer for search tools
      return (
        <div className="text-sm font-mono bg-muted/50 px-3 py-2 rounded-md border">
          <div className="text-muted-foreground">Pattern:</div>
          <div>{(input as any).pattern}</div>
          {(input as any).path && (
            <>
              <div className="text-muted-foreground mt-2">Path:</div>
              <div>{(input as any).path}</div>
